import React from "react";

const AboutUs = () => {
  return (
    <>
      <div class="container-fluid">
        <div class="container">
          <div class="row">
            <h1 class="text-center pt-4 text-text-capitalize">form</h1>
            <hr class="w-25 mx-auto " />
          </div>
        </div>
      </div>
    </>
  );
};
export default AboutUs;
